    fetch("/api")
      .then((res) => res.json())
      .then(data => {console.log(data);
    });
  }, []);

  const fetchData = () => {
    return fetch("https://randomuser.me/api/")
          .then((response) => response.json())
          .then((data) => console.log(data));}

